13.body:
JavaScript is Dynamically-typed language meaning the interpreter assigns variables a type at runtime based on the variable's value at the time. Thus, JavaScript provide special keyword called typeof to get the type of the value. console.log(typeof undefined)
// undefined console.log(typeof "hello")
// string console.log(typeof 11)
// number console.log(typeof true)
// boolean console.log(typeof {})
// object

15.body:
In JavaScript, Strings are values made up of text and can contain letters, numbers, symbols, punctuation, and even emojis! Let's look at different type of strings. console.log(typeof "hello!!")
// string console.log(typeof "7")
// string console.log(typeof "")
// string console.log(typeof " ")
// string console.log(typeof new Date())
// string

16.body:
Numbers are values that can be used in mathematical operations. You don’t need any special syntax for numbers — just write them straight into JavaScript. console.log(7)
// number
console.log(3.14159265359)
// number // But what's the limit, well you can check like this
console.log(Number.MAX_SAFE_INTEGER)
// 9007199254740991
console.log(Number.MIN_SAFE_INTEGER)
// -9007199254740991 NOTE: More on Number later. But if you're curious, then read the source .

