19.body:
Objects are variables that contain multiple data values. The values within a JS object are known as properties. Objects use keys to name values, much like how is done with variables. Objects are nothing but collection of values. Discuss it later. // Well Arrays are also objects
console.log(typeof [])
// object // And so is null
console.log(typeof null)
// object

20.body:
Array are special type of object. That hold other values in order. The values inside an array are called elements. Array elements don’t all have to be the same type of value. Elements can be any kind of JavaScript value — even other arrays or objects. console.log(typeof [1,2,3,4,5])
// object console.log(typeof ["Naruto", "Sasuke", "Kakashi"])
// object console.log(typeof ["Naruto", 1, true, {}, null, undefined])
// object NOTE: You can also read about Map , Set , BigInt and Symbol . But we don't have to worry about them right now.

