It is an ancient way for declaring variable, and before ES6 , the only way. But it use to cause lot of confusion because of its functional scope (lexical scoping). And that is how it different form let and const, because of its scope . A general thumb rule, use let over var. console.log(message_with_var);
var message_with_var = "hello world";
console.log(message_with_var);
