Operators like +, -, *, / and %. // Division
console.log(11/3)
// Multiplication
console.log(5*2)
// Subtraction
console.log(101-1)
// Addition
console.log(10+1)
// Addition can also be use to concatenate (combine) strings
console.log("Hello " + "World ")
// Modulus (Remainder)
console.log(10%3) // Combination
console.log(1/2*3-4+5)
console.log(5-4+3*1/2) Arithmetic operators follows the BODMAS rule , thus the order in which you write them is ir-relevant. You can use small brackets () to priorities certain operation.

30.body:
let count = 1;
console.log("Init count value: ", count); // Increment
// `++count` is equal to `count = count + 1`
console.log("count value after increment: ", ++count); // Decrement
// `--count` is equal to `count = count - 1`
console.log("count value after decrement: ", --count); console.log("Final count value: ", count); Increment & Decrement operator can also be used after the operand (like count++). The difference it will return the value before it is incremented.

